import React from 'react';
import ReactDOM from 'react-dom';
import './app.css';
import './style.css';
//import App from './App';
import SearchEngineApp from './SearchEngine'
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
    <SearchEngineApp />
  </React.StrictMode>,
  document.getElementById('root')
);


serviceWorker.unregister();
